import React, { useEffect, useState } from 'react';
import {Box} from "./Box"

export const Detail=(props)=>{
    const [item,setItem]=useState({})
    useEffect(()=>{
        setItem(props.adatok[0])
        console.log
    },[])
    console.log(Object.keys(props.temaKorok))
    console.log("=================")
    console.log(props.adatok[0])
    console.log(typeof(props.adatok[0]))
  
    console.log("----------------")
    return(     
        <React.Fragment>
           
            {Object.keys(props.temaKorok).filter(obj=>props.temaKorok[obj].length>5).map((obj, i) => <Box key={obj} tema={props.temaKorok[obj]}/>)}
        </React.Fragment>
        
    )
}
